import React from 'react';

// ELEMENTS
import { Grid, Text, Image } from '../elements/index';

// STYLE
import styled, { css } from 'styled-components';

// ICON
import FavoriteIcon from '@material-ui/icons/Favorite';
import { MessageCircle, Eye } from "react-feather";

// REDUX
import { history } from "../redux/configureStore";

const CommunityPost = ({community, category}) => {
  console.log(category);
  return (
    <Grid height="30px">
      <CommunityPostStyle>
        <Grid clickEvent={()=>history.push({
              pathname: '/communitypostdetail',
              category: category,
            })} >
            <Grid 
            addstyle={() => {
              return css`
              display: flex;
              justify-content:space-between;
              `;
            }}>
            <Grid
            addstyle={() => {
              return css`
              display: flex;
              `;
            }}>
              <Image 
                width={'25px'} 
                height={'25px'}
                addstyle={() => {
                  return css`
                  border-radius:25px;
                  `;
                }}/>
            <Text margin="4px" fontWeight={'bold'}>
            뽀삐맘
            {/* {community.username} */}
            </Text>
            <Text margin="0 10px 0 170px">
            2021-09-03 15:23
            </Text>
            </Grid>
        </Grid>
        <Grid margin="-50px 0">
          <Text fontWeight={'bold'} margin={'4px 0 0 0'}>
          9월 8일 (수) 18:00 망원 2동 순찰돕니다.
          {/* {community.title} */}
          </Text>
          <Grid 
            addstyle={() => {
              return css`
              display: flex;
              justify-content:space-between;
              `;
            }}>
              <Grid></Grid>
              <Grid addstyle={() => {
              return css`
              display: flex;
              justify-content:space-between;
              margin: 10px 0 0 120px;
              `;
            }}>
              <Grid 
                addstyle={() => {
                  return css`
                  display: flex;
                  `;
              }}>
                <Eye style={{width:'13px', margin:'-4px 3px 0 0'}}/>
                <Text size={'12px'} fontWeight={'bold'}>
                  1
                </Text>
              </Grid>
              <Grid 
                addstyle={() => {
                  return css`
                  display: flex;
                  `;
              }}>
                <MessageCircle style={{width:'13px', margin:'-4px 3px 0 0'}}/>
                <Text size={'12px'} fontWeight={'bold'}>
                  1
                </Text>
              </Grid>
              <Grid 
                addstyle={() => {
                  return css`
                  display: flex;
                  `;
              }}>
                <FavoriteIcon style={{width:'13px', margin:'-4px 3px 0 0', color:'red'}}/>
                <Text size={'12px'} fontWeight={'bold'}>
                  1
                </Text>
              </Grid>
              </Grid>
          </Grid>
        </Grid>
        </Grid>
      </CommunityPostStyle>
    </Grid>
  );
};

const CommunityPostStyle = styled.div`
  position: relative;
  top: 20px;
  background: rgb(${(props) => props.theme.palette.diaryColor});
  width:100%;
  height: 77px;
  margin: 80px 0;
  padding: 4px;
  cursor: pointer;
`;

export default CommunityPost;
